import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row, Navbar} from 'react-bootstrap';
import Sidebar from '../components/Sidebar';

const Home = () => {

    const MainSection = (props) => {
        return (
            <div className='main-section'>

                <h4 className="custom-font">เรื่องเล่าล่าสุด</h4>

                <Row>
                    <Col lg={8}>
                        Big card
                    </Col>
                    <Col lg={4}>
                        common card
                    </Col>
                </Row>
            </div>
        )
    }
    return (
        <div>
            <Navbar>
                    <a href="/">
                        <img className='logo' src={require('../resources/img/dearToday.PNG')} />
                    </a>

            </Navbar>
                <Row className="full-page">
                    <Col className='d-none d-sm-block noPadding' lg={2} sm={3}><Sidebar/></Col>
                    <Col className='noPadding' lg={10} sm={9} ><MainSection /></Col>

                </Row>
        </div>
    );
};

export default Home;
